<body>
  <main class="d-flex h-100">
    <div class="sidebar container-fluid bg-dark border-right" style="max-width: 310px">
      <div class="row py-3 mb-3 border-bottom">
        <div class="col-12">
          <span class="lead text-white">Stubs Server</span>
        </div>
      </div>
      <div class="row">
        <div class="col-12">
          <table class="table table-borderless table-striped table-dark">
            <tbody>
            <tr>
              <td onclick="sendGetRequest('/generate/userList')">
                <div class="d-flex flex-column">
                  <span>localhost:3000/generate/userList</span>
                </div>
              </td>
            </tr>
            <tr>
              <td onclick="sendGetRequest('/generate/contactList')">
                <div class="d-flex flex-column">
                  <span>localhost:3000/generate/contactList</span>
                </div>
              </td>
            </tr>
            <tr>
              <td onclick="sendGetRequest('/generate/customerList')">
                <div class="d-flex flex-column">
                  <span>localhost:3000/generate/customerList</span>
                </div>
              </td>
            </tr>
            </tbody>
          </table>
        </div>
      </div>
    </div>
    <div class="container-fluid overflow-auto bg-dark">
      <p class="text-white">Response</p>
      <div class="row">
        <div class="col-12 response-container">
          <pre class="text-white"></pre>
        </div>
      </div>
    </div>
  </main>

  <script>
    function sendGetRequest(route) {
      $.get(
        route,
        null,
        onAjaxSuccess
      );
    }


    function onAjaxSuccess(data)
    {
      $('.response-container > pre')
        .text('')
        .text(data)
    }
  </script>
</body>
